export class SignIn {
    fullName = '';
    email = '';
    password = '';
    phone = '';
    personalID = '';

    constructor(fullName, email, password, phone, personalID) {
        this.fullName = fullName;
        this.email = email;
        this.password = password;
        this.phone = phone;
        this.personalID = personalID;
    }
}
